import './App.css';
import { Switch, Route } from 'react-router-dom';
import Post from './Post';
import Header from './Header';

function App() {
  return (
    <main>
      <Header />
      <Switch>
        <Route path="/" exact component={Post} />
        <Route path="/post" component={Post} />
      </Switch>
    </main>
  );
}

export default App;
